import React from "react";
import styled from "styled-components";
const Button = styled.button`
    border: solid 2px #ffffff;
    color: #bc5a5a;
    background-color: #ffffff;
    box-shadow: 0px 0px 15px rgba(0, 0, 0, 0.3);

    font-size: 1.4rem;
`;
const Menu = () => {
    return (
        <div>
            <li>home</li>
        </div>
    );
};

export default Menu;
